import React from 'react';
import Section from '../common/Section';
import './Features.css';

const Features = () => {
  return (
    <Section id="features" className="features-section" background="light">
      <h2 className="section-title">80%</h2>
      <p className='description'>пользователей <span className='accent'> получают отклики </span> от работодателей уже в <span className='accent'>первый день</span> размещения резюме</p>
      <div className="feature-card">
        <p>наши пользователи</p>
        <div className="cir-grid">
          {Array.from({ length: 80 }).map((_, index) => (
            <div key={index} className="cirсle"></div>
          ))}
          {Array.from({ length: 20 }).map((_, index) => (
            <div key={index} className="cirсle"></div>
          ))}
        </div>
        <p>остальные кандидаты</p>
      </div>
    </Section>
  );
};

export default Features;
